import About from "./About/About";
import Contact from "./Contact/Contact";
import Details from "./Details/Details";
import Navbar from "./Header/Navbar";
import Portfolio from "./Portfolio/Portfolio";
import Service from "./Service/Service";
import Tagline from "./TagLine/Tagline";
import Team from "./Team/Team";
function App() {
  return (
    <div className="App">
      <div>
        {/* end of preloader */}
        {/* Navbar */}
        <Navbar />
        <Tagline />
        {/* Intro */}
        <div id="intro" className="basic-1">
          <div className="container">
            <div className="row">
              <div className="col-lg-5">
                <div className="text-container">
                  <div className="section-title">INTRO</div>
                  <h2>
                    It is a long established fact that a reader will be
                    distracted by the
                  </h2>
                  <p>
                    it look like readable English. Many desktop publishing
                    packages and web page editors now use Lorem Ipsum as their
                    default model text, and a search for 'lorem ipsum'
                  </p>
                  <p className="testimonial-text">
                    will uncover many web sites still in their infancy. Various
                    versions have evolved over the years, sometimes by accident,
                    sometimes on purpose (injected humour and the like).
                  </p>
                  <div className="testimonial-author">Rakib Islam - CEO</div>
                </div>{" "}
                {/* end of text-container */}
              </div>{" "}
              {/* end of col */}
              <div className="col-lg-7">
                <div className="image-container">
                  <img
                    className="img-fluid"
                    src="assets/images/intro-office.jpg"
                    alt="alternative"
                  />
                </div>{" "}
                {/* end of image-container */}
              </div>{" "}
              {/* end of col */}
            </div>{" "}
            {/* end of row */}
          </div>{" "}
          {/* end of container */}
        </div>{" "}
        {/* end of basic-1 */}
        {/* end of intro */}
        {/* Description */}
        <div className="cards-1">
          <div className="container">
            <div className="row">
              <div className="col-lg-12">
                {/* Card */}
                <div className="card">
                  <span className="fa-stack">
                    <span className="hexagon" />
                    <i className="fas fas-dev fa-binoculars fa-stack-1x" />
                  </span>
                  <div className="card-body">
                    <h4 className="card-title">Project Analysis</h4>
                    <p>
                      unchanged. It was popularised in the 1960s with the
                      release of Letraset sheets containing Lorem
                    </p>
                  </div>
                </div>
                {/* end of card */}
                {/* Card */}
                <div className="card">
                  <span className="fa-stack">
                    <span className="hexagon" />
                    <i className="fas fas-dev fa-list-alt fa-stack-1x" />
                  </span>
                  <div className="card-body">
                    <h4 className="card-title">Development Planning</h4>
                    <p>
                      packages and web page editors now use Lorem Ipsum as their
                      default model text, and a search for 'lorem ipsum' will
                      uncover many web sites still in their infancy.
                    </p>
                  </div>
                </div>
                {/* end of card */}
                {/* Card */}
                <div className="card">
                  <span className="fa-stack">
                    <span className="hexagon" />
                    <i className="fas fas-dev fa-chart-pie fa-stack-1x" />
                  </span>
                  <div className="card-body">
                    <h4 className="card-title">Execution &amp; Evaluation</h4>
                    <p>
                      packages and web page editors now use Lorem Ipsum as their
                      default model text, and a search for 'lorem ipsum' will
                      uncover many web sites still in their infancy.
